const getDataFromApi = (search) => {
  return fetch(
    "https://raw.githubusercontent.com/Adalab/rick-y-morty/master/data/rick-y-morty.json?search=" +
      search
  )
    .then((response) => response.json())
    .then((data) => {
      return data.results;
    });
};

export default {
  getDataFromApi: getDataFromApi,
};
